css:
@-moz-document url-prefix("https://forum.frandroid.com/") {
/** Petit filou va :p Suis-moi sur Twitter :  @romainlekps */
 html {
	background-color: #343434
}
#page {
	background-color: #272727
}
body {
	background-color: #2e2e2e;
	color: #6271c7
}
.has-background-white {
	background-color: #363636 !important
}
#header .header__category-link {
	color: #b573c5
}
.menu-burger .menu-burger-background::after {
	background-color:#000000ed;
	background-size: 500px auto;
}
.menu-burger .menu-burger-inner {
	background-size: 350px auto;
	color: #b4b4b4
}
.post-card--edito .post-card-edito__text-container {
	background: #000
}
.post-card--edito .post-card-edito__title-link {
	color: #545e95
}
.post-card {
	background-color: #1a1a1a
}
.post-card .rich-content__item-link {
	color: #7781b6
}
.post-card__title-link {
	color: #8c3f8d
}
.post-card.post-card--vertical {
	background-color: #171717
}
.has-text-white {
	color: #313131 !important
}
.listplans-shortcode-plan {
	background-color: #0f0f0f;
	color: #7e88bb
}
.fr-button.fr-button--inverted {
	background: #5569d7;
	color: #000
}
.post-card.post-card--lite {
	color: #6772ac
}
.video__title {
	color: #8a56a5;
}
.video__play-button {
	color: #1c1c1c;
}
.post-card--featured .post-card__title-link {
	color: #000;
}
.fr-button.fr-button--white:hover, .fr-button.fr-button--white:focus {
	background: #484848;
	color: #425fff;
}
.fr-button.fr-button--white {
	border-color: #484848;
	color: #fff;
}
#header .header__top-bar {
	box-shadow: 0.25rem 0.25rem 1.75rem 0px rgb(42, 42, 42)
}
.menu-burger__title a:hover, .menu-burger__title a:focus {
	color: #834aa6
}
.search-modal--open {
	background-color: #1f1f1f
}
.search-field__input {
	background: #636363
}
.search-field__form {
	color: #8591ca
}
.has-background-gradient-radial-blue-purple {
	background: radial-gradient(ellipse 100% 400% at 50% 100%, #273266 0%, #c644fd 100%)
}
.has-text-white {
	color: #cbcbcb !important;
}
.has-background-gradient-radial-pink-orange {
	background: radial-gradient(ellipse 100% 400% at 50% 100%, #66275a 0%, #fe6652 100%)
}
.has-background-gradient-radial-orange-pink {
	background: radial-gradient(ellipse 100% 400% at 50% 100%, #6d3730 0%, #f8549e 100%)
}
.buy-top-products {
	background-color: #232323;
	box-shadow: 0.25rem 0.25rem 1.25rem rgba(0, 0, 0, 0.6);
}
.has-text-primary {
	color: #d2aa78e8 !important;
}
.buy-top-products .product-card.product-card--lite .product-card__title-text {
	color: #d2aa78e8;
}
.fr-button.fr-button--inverted:hover {
	background: #95538a;
	border-color: #95538a
}
.page-card {
	background-color: #1e1e1e
}
.page-card__title {
	color: #616b9c
}
.video__title {
	align-items: center;
	background-color: #313131
}
.slider__container--scroll-container .is-shadow-right {
	background-color: #696969
}
.has-text-blue {
	color: #6f0a70;
}
.fr-button.fr-button--transparent {
	border-color: transparent;
	color: #c7d0fd
}
}
